import React, {Component} from 'react';
import styled from 'styled-components';
import {lightGreen} from 'variables';
import {Formik} from 'formik';

const SignUpContainer = styled.div`
    display: flex;
    background-color: ${lightGreen};
`;

const SignUpForm = styled.form`
    margin: 5px;
`

class SignUp extends Component {


    render(){
        return <Formik>
                    {({
                        values,
                        errors,
                        touched,
                        handleChange,
                        handleBlur,
                        handleSubmit,
                        isSubmitting,
                        /* and other goodies */
                    }) => (<SignUpContainer>
                            <h2>Sign up</h2>
                                <SignUpForm onSubmit={handleSubmit}>
                                    <input
                                        type="email"
                                        name="email"
                                        onChange={handleChange}
                                        value={values.email}
                                    />
                                    <input
                                        type="text"
                                        name="name"
                                        onChange={handleChange}
                                        value={values.name}
                                    />
                                    <input
                                        type="text"
                                        name="daily calorie goal"
                                        onChange={handleChange}
                                        value={values.dailyCalorieGoal}
                                    />
                                    <input
                                        type="password"
                                        name="password"
                                        onChange={handleChange}
                                        onBlur={handleBlur}
                                        value={values.password}
                                    />
                                    <button type="submit" disabled={isSubmitting}>
                                        Submit
                                    </button>
                                </SignUpForm>
                    </SignUpContainer> )}
                </Formik>
    }
}

export default SignUp;
